import {
    Select,
    MenuItem,
    FormControl,
    InputLabel
} from '@mui/material';
import { useState } from 'react';

const OrderPage = ({ dataList }) => {
    useEffect(() => {
        fetchInventoryList()
    }, [])
    const handleChange = (event) => {
        setSelectedItem(event.target.value);
    };

    return (
        <FormControl fullWidth>
            <InputLabel id="item-label">Item</InputLabel>
            <Select
                labelId="item-label"
                onChange={handleSelect}
                label="Item"
            >
                {/* Optional chaining to avoid errors */}
                {dataList?.map((item) => (
                    <MenuItem key={item.id} value={item.inventoryName}>
                        {item.inventoryName}
                    </MenuItem>
                ))}
            </Select>
        </FormControl>
    );
};

export default OrderPage;
